import React, {useEffect, useState} from 'react'

const UseEffectAPI = () => {


    const [users, setUsers] = useState([])


    const getUsers = async () =>{
        const response = await fetch('https://api.github.com/users')
        setUsers (await response.json());
    }
    useEffect(() =>{
        getUsers();
    }, []);
  return (

    <div>
        <h2>List Github Users</h2>
        <div className='container-fluid mt-5'>
            <div className='card p-2'>
                <h4 className='mb-8 mt-0 textLeft'></h4> <span className='textLeft'></span>
                <div className='p-2 mt-2 bg-primary d-flex justify-content-between rounded text-white stats'>
                    <div className='d-flex flex-column'></div> <span className='articles'></span> <span className='number1'></span>
                    <div className='d-flex flex-column'> <span className='followers'></span></div> <span className='number2'></span>
                    <div className='d-flex flex-column'> <span className='rating'></span></div> <span className='number3'></span>
                </div>

            </div>
        </div>
    </div>
  )
}
export default UseEffectAPI
